window.bookSummaryJSON = "<p>As the conflict between Enosh and Damasca builds to war, Simon finds himself caught in the middle.</p> <p>Alin is bound by prophecy to the Grandmasters of Enosh, but he begins to doubt his fate when he discovers that their talk of freedom hides a darker agenda.</p> <p>Leah has never questioned her loyalty to Damasca. Now, she finds that allegiance tested as she is forced to oppose her own rebellious brother.</p> <p>With these two powers on the brink of open war, the land soon trembles in the face of an even greater threat.</p> <p>Who can stand against the Wanderer?</p>"; 
